sentences:
  - A Japanese study found that frequent lettuce consumption was associated with lower risk of breast cancer.
  - One Mexican study found that consumption of lettuce was associated with lower risk of breast cancer in premenopausal women.
  - A Greek study found that women with breast cancer consumed significantly less lettuce than those without breast cancer.
